import React from 'react';
import CardList from '../components/CardList';

function Cards() {
  const containerStyle = {
    display: 'flex',
    flexDirection: 'column',
    alignItems: 'center',
    margin: '0 20px'
  };

  return (
    <div style={containerStyle}>
      <h1>Trading Cards</h1>
      <CardList />
    </div>
  );
}

export default Cards;
